  let isMounted = true;

  const fetchData = async () => {
    try {
      const result = await apiCall();
      if (isMounted) {
        setState(result);
      }
    } catch (error) {
      if (isMounted) {
        setError(error);
      }
    }
  };

  fetchData();

  return () => {
    isMounted = false;
  };
}, []);
```

**Or use AbortController for fetch requests:**
```javascript
